--declare @AlertDate int=6
select @Comp 公司,@AlertDate 通知日期,DATEPART(month, DATEADD(MONTH,1,dbo.Today()))月份 where DATEPART(day,dbo.Today())=@AlertDate', '20210706 00:00:00.000', N'JB', N'--declare @公司 nvarchar(50)=''02''
--declare @通知日期 int=13
select ds.D_NO_DISP 成本中心, ds.D_NAME 成本中心名稱,bs.NOBR 員工編號,bs.NAME_C 員工姓名,convert(nvarchar(10),bts.INDT,111) 到職日期,convert(nvarchar(10),bs.BIRDT,111) 出生日期  from BASE bs
join  BASETTS bts on bs.NOBR=bts.NOBR 
join DEPTS ds on ds.D_NO=bts.DEPTS
where bts.COMP=@公司 and dbo.Today() between bts.ADATE and bts.DDATE and bts.TTSCODE in (''1'',''4'',''6'')
and DATEPART(month, DATEADD(MONTH,1,dbo.Today()))=DATEPART(month, bs.BIRDT)
and DATEPART(day,dbo.Today())=@通知日期
order by DATEPART(day, bs.BIRDT)
')
--declare @提醒天數 int =7
select @公司 公司,@提醒天數 提醒天數
where exists(
select NOBR,AP_DATE from BASETTS where dbo.Today() between ADATE and DDATE
and AP_DATE is not null
and TTSCODE in (''1'',''4'',''6'') and AP_DATE=DATEADD(day,1*@提醒天數,dbo.Today())
and COMP=@公司)
--order by AP_DATE', '20210819 00:00:00.000', N'JB', N'--declare @公司 nvarchar(50)=''01''
--declare @提醒天數 int =7
--select @公司 公司,@提醒天數 提醒天數
--where exists(
select DEPT.D_NAME 編制部門,BASETTS.NOBR 員工編號,BASE.NAME_C 員工姓名,BASETTS.INDT 到職日,CONVERT(nvarchar,BASETTS.AP_DATE,111) 試用期滿日 from BASETTS
join BASE on BASETTS.NOBR=BASE.NOBR
join DEPT on BASETTS.DEPT=DEPT.D_NO
where dbo.Today() between BASETTS.ADATE and BASETTS.DDATE
and AP_DATE is not null
and TTSCODE in (''1'',''4'',''6'') and AP_DATE=DATEADD(day,1*@提醒天數,dbo.Today())
and COMP=@公司
--)
order by AP_DATE')
--declare @通知天數 int=1
select @公司 公司,@通知天數 通知天數
where exists(
select d.D_NAME 編制部門,c.Nobr 員工編號,bs.NAME_C 員工姓名,ct.DisplayName 合同名稱,CONVERT(nvarchar,c.Adate,111) 合同生效日,CONVERT(nvarchar,c.Ddate,111) 合同失效日 from Contract c
join BASETTS bt on c.Nobr=bt.NOBR
join BASE bs on c.Nobr=bs.NOBR
join ContractType ct on c.ContractType=ct.Code
join DEPT d on d.D_NO=bt.DEPT
where dbo.Today() between bt.ADATE and bt.DDATE
and c.Ddate =DATEADD(day,@通知天數,dbo.Today())
and bt.COMP=@公司
)
', '20210819 00:00:00.000', N'JB', N'--declare @公司 nvarchar(50)=''AZOTEK''
--declare @通知天數 int=1
select d.D_NAME 編制部門,c.Nobr 員工編號,bs.NAME_C 員工姓名,ct.DisplayName 合同名稱,CONVERT(nvarchar,c.Adate,111) 合同生效日,CONVERT(nvarchar,c.Ddate,111) 合同失效日 from Contract c
join BASETTS bt on c.Nobr=bt.NOBR
join BASE bs on c.Nobr=bs.NOBR
join ContractType ct on c.ContractType=ct.Code
join DEPT d on d.D_NO=bt.DEPT
where dbo.Today() between bt.ADATE and bt.DDATE
and c.Ddate =DATEADD(day,@通知天數,dbo.Today())
and bt.COMP=@公司')
--declare @通知天數 int =7
select @公司 公司,@通知天數 通知天數
where exists(
select d.D_NAME 編制部門, bs.NOBR 員工編號,bs.NAME_C 員工姓名,bt.STINDT 留停日期,bt.ReinstateDate 預計復職日 from BASETTS bt
join BASE bs on bt.NOBR=bs.NOBR
join DEPT d on d.D_NO=bt.DEPT
where bt.ReinstateDate = DATEADD(day,@通知天數,dbo.Today())
and bt.COMP=@公司
and dbo.today() between bt.ADATE and bt.DDATE
and bt.TTSCODE in (''1'',''4'',''6'')
)', '20210819 00:00:00.000', N'JB', N'--declare @公司 nvarchar(50) =''A''
--declare @通知天數 int =7
select d.D_NAME 編制部門, bs.NOBR 員工編號,bs.NAME_C 員工姓名,bt.STINDT 留停日期,bt.ReinstateDate 預計復職日 from BASETTS bt
join BASE bs on bt.NOBR=bs.NOBR
join DEPT d on d.D_NO=bt.DEPT
where bt.ReinstateDate = DATEADD(day,@通知天數,dbo.Today())
and bt.COMP=@公司
and dbo.today() between bt.ADATE and bt.DDATE
and bt.TTSCODE in (''1'',''4'',''6'')
')
